import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'; // Import the CSS file for styling

function Header() {
  return (
    <header className="header">
      <nav className="navbar">
        <ul className="nav-list">
          <li className="nav-item"><Link to="/">FindJobs</Link></li>
          <li className="nav-item"><Link to="/postjobs">PostJobs</Link></li>
          <li className="nav-item"><Link to="/resources">Resources</Link></li>
          <li className="nav-item"><Link to="/join" className="join-button">Join Now</Link></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
